import random


def generate_pattern_data(num_samples):
    """
    生成符合要求的 pattern_data 字典。
    :param num_samples: 生成的总样本数量
    :return: 符合要求的 pattern_data 字典
    """
    pattern_datas = {"interesting": [], "uninteresting": [], "target": []}

    # 计算 interesting 和 uninteresting 的数量
    # 假设 interesting 和 uninteresting 的比例为 1:1
    num_interesting = num_samples // 2
    num_uninteresting = num_samples - num_interesting

    # 生成 interesting 数组
    for _ in range(num_interesting):
        vector = [random.randint(0, 1) for _ in range(9)]  # 生成前 9 位
        vector.append(1)  # 最后一位很大（0.9 到 1）
        pattern_datas["interesting"].append(vector)

    # 生成 uninteresting 数组
    for _ in range(num_uninteresting):
        vector = [random.randint(0, 1) for _ in range(9)]  # 生成前 9 位
        vector.append(0)  # 最后一位很小（0 到 0.1）
        pattern_datas["uninteresting"].append(vector)

    # 生成 target 数组
    # target 是一个二维数组，包含两个一维数组
    # 第一个数组是全 1，长度与 interesting 的数量相同
    # 第二个数组是全 0，长度与 uninteresting 的数量相同
    target = [[1] * len(pattern_datas["interesting"]), [0] * len(pattern_datas["uninteresting"])]
    pattern_datas["target"] = target

    return pattern_datas


# 示例调用
num_samples = 250  # 生成的总样本数量
support_datas = generate_pattern_data(num_samples)

print(support_datas)

